Whoops!  Lesson learned. Guess I should listen to myself!  I didn’t install a simple rope to pull the tree over “just in case”. Murphy’s Law!  All worked out but things could have been cleaner. More predictable. More safety and control. I won’t say “naaah” next time. Has this ever happened to you?
.
@atmostreeorg is a planting alliance (I founded) specifically designed for arborists.  We collect a small recycling fee from our clients that covers the costs associated with planting two new trees elsewhere.  This results in our company being responsible for planting MORE trees than we remove in the world. Atmos Tree takes care of everything including all of the marketing material to advertise our commitment 😉. Zero cost to join and partner with us!!! Please reach out and I’ll send over more info 🌱

Wow! 30 members already!  Check out our website where we feature our partners in good standing. Tree clients can visit and see what the alliance is up to and verify the affiliation with Atmos Tree. We backlink to our members websites and help which helps with their SEO. Click on one of our members logos to see where they are from! 
.
